import React from "react";
import { Card } from "../../UI/Card.styled";

const List = ({ fontSizes, UI, colors, items }) => {
  return (
    <>
      <Card bd={"1px solid red"}>
        <Card fs={fontSizes.textHeader} bd={"1px solid blue"} height={"2rem"}>
          {items.Header}
        </Card>
      </Card>
    </>
  );
};

export default List;
